import React from 'react';
import P3 from '../components/P3';

function L5() {
    const [result,setResult]=useState(false);
    function handleClick(){
        setResult(true);
    }
  return (
    result ? <P3 /> :
    <div className='L1-body'>
      <h1>Vowel Signs Example</h1>
      <article>Here is how they are typically used with a base consonant.This pattern continues for each consonant, combining with the vowel signs to form different syllables.
        <br />
        Click on <u>Next</u> to continue.
      </article>
      <button>Next</button>
    </div>
  )
}

export default L5;
